import { SET_USER , UPDATE_USER_USERNAME, UPDATE_USER_IMAGE  } from '../actions'

const initialState = []

const reducer = (state = initialState, action) => {
  switch (action.type) {
    case SET_USER:
      return action.user
    case UPDATE_USER_USERNAME:
      let newState = {...state}
      newState.username = action.username
    return newState
    // case UPDATE_USER_IMAGE:
    //   let newState = {...state}
    //   newState.picture = action.image
    // return newState
    default:
      return state
  }
}
export default reducer
